//dotMap class definition
//container is a reference to the element meant to hold the map
function dotMap(container){
  this.wrap = d3.select(container);
  this.width = 950;
  this.height = this.width * this.aspect;

  //this.currentMap = this.wrap.insert("div",":first-child").classed("quick-map-container",true);
  this.mapTitle = this.wrap.append("p").classed("map-title",true).style("margin","0px").style("padding","0px");
  this.currentMap = this.wrap.append("div").classed("quick-map-container",true);
  
  this.svg = this.currentMap.append("svg").style({"width":"100%", "height":"100%"}).append("g").attr("transform","translate(0,0)");
  this.stateG = this.svg.append("g");
  this.dotG = this.svg.append("g");
  
  //DOT HIGHLIGHTING
  this.annoG = this.svg.append("g");
  //4 dots total:
  //the 2 "pin" dots are meant to indicate a (persistent) metro selection; the 2 "hover" dots are meant to signal a (temporary) metro highlight/selection/hover
  //within each pair, the "match" dot is meant to match the underlying dot attrs, while the other ("loc") dot serves to indicate location--it defaults to an oversized, empty circle
  //set sensible defaults for "loc" ("highlight") attributes
  this.dotHL = {pin:{geo:null, r:2, stroke:"#333333"}, hover:{geo:null, r:2, stroke:"#333333"}}; 
  this.dotHL.pin.match = this.annoG.append("circle").attr({"cx":"-100","cy":"-100","r":"0","fill":"#ffffff"}).style("pointer-events","none");
  this.dotHL.pin.loc = this.annoG.append("circle").attr({"cx":"-100","cy":"-100","r":"0","fill":"#ffffff"}).style("pointer-events","none");
  this.dotHL.hover.match = this.annoG.append("circle").attr({"cx":"-100","cy":"-100","r":"0","fill":"#ffffff"}).style("pointer-events","none");
  this.dotHL.hover.loc = this.annoG.append("circle").attr({"cx":"-100","cy":"-100","r":"0","fill":"#ffffff","stroke-width":"5px"}).style("pointer-events","none");

  this.tooltip = this.currentMap.append("div")
      .style({"position":"absolute", "display":"block", "visibility":"hidden",
              "width":"auto", "height":"auto", "pointer-events":"none",
              "top":"0px", "left":"0px", "padding":"5px 8px 5px 8px",
              "border":"1px solid #dddddd", "background-color":"#ffffff"
            });

  //create a non-visible area to test tooltip width without worrying about (browser-forced) text wrapping (when tooltip overflows window)
  this.tiptest = this.currentMap.append("div")
      .style({"position":"absolute", "display":"block", "visibility":"hidden",
              "width":"auto", "height":"auto", "pointer-events":"none",
              "top":"0px", "left":"0px", "padding":"5px 8px 5px 8px",
              "border":"1px solid #dddddd", "background-color":"#ffffff"
            });

  this.overlay = this.currentMap.append("div")
      .style({"position":"absolute", "width":"100%", "height":"100%", "background-color":"rgba(255,255,255,0.85)", "left":"0px", "top":"0px", "display":"none", "opacity":"0"})

  this.proj = d3.geo.albersUsa().scale(this.width*this.proj_scale).translate([this.width/2, this.height/2]);  
  this.path = d3.geo.path().projection(this.path);

  this.metros = null;
  this.states = null;

  this.lookup = null; //metro info
  this.getProjected = null; //accessor function to get projected coordinates for each metro data element -- enabled by setData()

  this.data = null; //holds data, set in setData method

  this.onResize = []; 

  this.getText = function(code){return "No data available."}

  //basic styles
  this.currentMap.style({"position":"relative", "overflow":"visible", "height":(this.height)+"px", "width":"auto"});
}

dotMap.prototype.aspect = 0.7; //determines the height of the svg container
dotMap.prototype.proj_scale = 1.35; //scalar (of width) to be used for the Albers projection
